    await page.waitForSelector('.search-btn');
    await page.click('.search-btn');

    // Wait for the results to load (you may need to adjust the selector based on the actual results)
    await page.waitForSelector('.event-results'); // Adjust this selector based on the actual results container

    // Take a screenshot after the search results are displayed
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Extract meaningful data to verify task completion
    const results = await page.evaluate(() => {
      const events = [];
      const eventElements = document.querySelectorAll('.event-results .event-item'); // Adjust based on actual structure
      eventElements.forEach(event => {
        events.push({
          title: event.querySelector('.event-title')?.innerText, // Adjust based on actual structure
          date: event.querySelector('.event-date')?.innerText // Adjust based on actual structure
        });
      });
      return events;
    });

    return {
      success: true,
      action: "Searched for team-related events",
      extractedData: results,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
